import React from 'react';
import $ from 'jquery';

function Shipping() {

    let locationData = sessionStorage.getItem('locationData.')

    if (locationData === null)
        $.ajax({
            url: 'https://yrtt-readers.github.io/the-bookclub/assets/data/location.json',
            async: false,
            success: data => {
                try {
                    sessionStorage
                        .setItem('book.' + isbn,
                            JSON.stringify(data.filter(book => book.isbn === isbn)[0]))

                    bookData = sessionStorage.getItem('book.' + isbn)
                } catch (e) { console.log(e) }
            }
        })

    bookData = JSON.parse(bookData)


    return (
        <div>
            <section className="container container-margin">
                <div className="text-center">
                    <h1 className="text-center">Drop off or pick up your books at:</h1>
                </div>
            </section>
        </div>
    );
}

export default Shipping;
